import React from 'react';
import './Dm.css';

const Aside = () => {
	return (
		<div className="dm-aside">
			<h1>Aside</h1>
		</div>
	);
};

export const Dm = () => {
	return (
		<div className="dm">
			<Aside />
			<div className="dm-chat"></div>
		</div>
	);
};
